        super(props)

        this.state = {
            is_closing: ""
        }

        this.closeWindow = this.closeWindow.bind(this)
    }

    closeWindow(){
        this.setState(state => ({
            is_closing: "closing"
        }), () => {
            setTimeout(() => {this.props.setCurCard(null)}, 400)
        })
    }

    render(){
        return <div className="sort_card_mob">

        </div>
    }
}

